import React from 'react';

const Checkbox = ({title, options}) => {
	return (
		<fieldset>
			<legend>{title}</legend>
			{options.map(option => (
				<div key={option.id}>
					<input type={"checkbox"} name={title} id={`${option.id}_checkbox_${option.content}`} value={option.content}></input>
					<label htmlFor={`${option.id}_checkbox_${option.content}`}>{option.content}</label>
				</div>
			))}
		</fieldset>
	);
};

export default Checkbox;
